import CrossButton from "../../../../../CrossButton";

const SumCell = ({
   className,
   value,
   sumMouseEnterHandler,
   sumMouseLeaveHandler,
}) => {
   const classes = className ? className : "sum-cell";
   return (
      <td
         className={classes}
         onMouseEnter={sumMouseEnterHandler}
         onMouseLeave={sumMouseLeaveHandler}
      >
         <div>{value}</div>
         <CrossButton
            buttonClickHandler={() => dispatch(removeRow(rowNumber))}
         />
      </td>
   );
};

export default SumCell;
